const theme = createTheme({
    status: {
      danger: '#e53e3e',
    },
    palette: {
      primary: {
        main: '#1db954',
        darker: '#053e85',
      },
      neutral: {
        main: '#1db954',
        contrastText: '#fff',
      },
    },
  });

